import React, {useState, useEffect} from 'react'
import {Link, NavLink} from 'react-router-dom'

function Navbar(){

  return(
    <ul>
      <li><Link href="/">Home</Link></li>
      <li><Link href="/blog">Blog</Link></li>
      <li><Link href="/contact">Contact</Link></li>
    </ul>
  )
}

export default Navbar
